import React, { Component } from "react";
import {
  TextField,
  Container,
  Button,
  Tabs,
  Tab,
  TabPanel
} from "@material-ui/core";

export default class Lgon extends Component {
  state = {
    value: "one"
  };
  render() {
    return (
      <div>
        <Tabs
          value={this.state.value}
          onChange={(event, newValue) => {
            this.setState({ value: newValue });
          }}
        >
          <Tab value="zero" label="LOGIN"></Tab>
          <Tab value="one" label="REGISTER"></Tab>
        </Tabs>
        <TabPanel value="zero">
          <Container>
            <TextField
              style={{ width: 500 }}
              label="Email"
              margin="dense"
              variant="outlined"
            />
            <br />
            <TextField
              style={{ width: 500 }}
              label="Passworld"
              margin="dense"
              variant="outlined"
              type="password"
            />
            <br />
            <Button
              style={{
                width: 500,
                marginTop: 50,
                background: "yellow",
                color: "black"
              }}
            >
              LOGIN
            </Button>
          </Container>
        </TabPanel>
        <TabPanel value="one"></TabPanel>
      </div>
    );
  }
}
